import React from 'react';
import { BrowserRouter as Router, Route, Link, Switch } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";
import CreateCompanies from "./pages/create-companies.component";
import CompaniesList from "./pages/companies-list.component";
import Login from "./pages/login.component";
import Logout from "./pages/logout.component";
//import EditTodo from "./components/edit-todo.component";
//import TodosList from "./components/todos-list.component";
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <Router>
        <div className="container">
          <nav className="navbar navbar-expand-lg navbar-light bg-light">
            <a className="navbar-brand" href="https://codingthesmartway.com" target="_blank">
              <img src={logo} width="30" height="30" alt="CodingTheSmartWay.com" />
            </a>
            <Link to="/" className="navbar-brand">Todo App</Link>
            <div className="collpase navbar-collapse">
              <ul className="navbar-nav mr-auto">
                <li className="navbar-item">
                  <Link to="/" className="nav-link">Todos</Link>
                </li>
                <li className="navbar-item">
                  <Link to="/create" className="nav-link">Create Companies</Link>
                </li>
                <li className="navbar-item">
                  <Link to="/login" className="nav-link">Login</Link>
                </li>
                <li className="navbar-item">
                  <Link to="/logout" className="nav-link">Log out </Link>
                </li>
              </ul>
            </div>
          </nav>
          <br/>
          <Switch>
          <Route path="/create" component={CreateCompanies} />
          <Route path="/" component={CompaniesList} />

          </Switch>
          <Switch>
          <Route path="/login" component={Login} />
          <Route path="/logout" component={Logout} />
          </Switch>
        </div>
      </Router>
  );
}


export default App;
